import React from "react"
import "./Input.css"

function Input({message}) {

    return(
      <form className="form">
       <input className="input"
       placeholder="Type a message here... "
       value={message}
       onChange={(mes) => setMessage()}
       />
       <button></button>
      </form>
    )
}

export default Input
